script: |
  super -f text -I q8294.spq | sort > q8294.out

inputs:
  - name: q8294.spq
    data: |
      SELECT + col0 FROM tab1 (FORMAT parquet) WHERE NOT - 76 BETWEEN - + col0 / + col0 AND ( + 79 * - ( + - 24 ) + col0 );
  - name: tab1

outputs:
  - name: q8294.out
    data: |
      51
      85
      91
